import { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

export default function App() {
  const [commissionData, setCommissionData] = useState([]);
  const [violationData, setViolationData] = useState([]);
  const navigate = useNavigate();

  const userEmail = localStorage.getItem('userEmail');

  useEffect(() => {
    if (!userEmail) {
      navigate('/');
      return;
    }

    fetch('https://script.google.com/macros/s/AKfycbzSjgMyzv1ciX5MeW_f5Doh9gWydDGpN2Txz8gUSdf1nNq8TpxWlyyGFvJCbG-QwJM4/exec')
      .then(res => res.json())
      .then(data => {
        const filtered = data.filter(row => row.Email.toLowerCase() === userEmail.toLowerCase());
        setCommissionData(filtered);
      });

    fetch('https://script.google.com/macros/s/AKfycbw5FIPX_XqlxHqwEuZZqugW0cwNG1zk2SI28q8ri0cm7XDDEkZ1ncgUk5v6ZMGrvpJp/exec')
      .then(res => res.json())
      .then(data => {
        const filtered = data.filter(row => row.Email.toLowerCase() === userEmail.toLowerCase());
        setViolationData(filtered);
      });

  }, [userEmail, navigate]);

  const logout = () => {
    localStorage.removeItem('userEmail');
    navigate('/');
  };

  return (
    <div style={{ padding: 40 }}>
      <h1>Welcome, {userEmail}</h1>
      <button onClick={logout}>Logout</button>

      <h2>Commission Data</h2>
      <pre>{JSON.stringify(commissionData, null, 2)}</pre>

      <h2>Violations & AR Data</h2>
      <pre>{JSON.stringify(violationData, null, 2)}</pre>
    </div>
  );
}
